import React from 'react';
import TaskItem from './TaskItem';

interface TaskListProps {
    tasks: Array<{
        id: string;
        title: string;
        completed: boolean;
    }>;
}

const TaskList: React.FC<TaskListProps> = ({ tasks }) => {
    return (
        <div>
            {tasks.map((task) => (
                <TaskItem key={task.id} task={task} />
            ))}
        </div>
    );
};

export default TaskList;
